CREATE TABLE `files_meta` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `file_id` bigint(20) DEFAULT NULL COMMENT '파일 아이디',
  `parent` bigint(20) DEFAULT NULL COMMENT '키값에 대응하는 부모아이디',
