  `idx` int(11) DEFAULT 1 COMMENT '파일 메타 인덱스',
  `value` text DEFAULT NULL COMMENT '파일 메타 값',
  `create_at` datetime DEFAULT current_timestamp(),
  `update_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `img_meta_file_id_IDX` (`file_id`) USING BTREE,
  KEY `img_meta_parent_IDX` (`parent`) USING BTREE,
  KEY `img_meta_img_key_IDX` (`file_key`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=163 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_uca1400_ai_ci;
