--
-- Table structure for table `notify_history`
--

DROP TABLE IF EXISTS `notify_history`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `notify_history` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '알림 시퀀스 아이디',
  `type` int(11) DEFAULT NULL COMMENT '알림 타입 1:게시물 추천, 2:게시물 댓글, 3: 댓글에 대댓글, 4:팔로우, 5:게시물 업로드, 6:정산 완료, 7: 영상 후원, 8:크레이터 후원',
  `target_id` bigint(20) DEFAULT NULL COMMENT '알림을 준 타켓 유저 아이디( 예) 상대방 사용자 아이디), 1:user_id, 2:user_id, 3:user_id, 4:user_id, 5:user_id, 6:null, 7:user_id, 8:user_id',
  `target_name` varchar(500) DEFAULT NULL COMMENT '알림을 준 타겟의 이름',
  `user_id` bigint(20) DEFAULT NULL COMMENT '알림 받은 사용자 아이디',
  `relation_id` bigint(20) DEFAULT NULL COMMENT '알림 받도록 한 연관 아이디. 예) 게시물, 댓글 아이디, 1: post_id, 2: post_id, 3:reply_id, 4:null, 5:null, 6:null, 7:post_id, 8:null',
  `relation_name` varchar(500) DEFAULT NULL COMMENT '알림 받도록 한 연관 아이디 테이블의 제목 또는 내용',
  `is_reading` int(11) DEFAULT 0 COMMENT '글을 읽었는지 확인 -  0 : 안읽음, 1: 읽음',
  `create_at` datetime DEFAULT current_timestamp(),
  `update_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `notify_history_target_id_IDX` (`target_id`) USING BTREE,
  KEY `notify_history_user_id_IDX` (`user_id`) USING BTREE,
  KEY `notify_history_notified_id_IDX` (`relation_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=476 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_uca1400_ai_ci COMMENT='알림 내역';
/*!40101 SET character_set_client = @saved_cs_client */;

