  `value` varchar(300) DEFAULT NULL COMMENT '메타 값',
  `create_at` datetime DEFAULT current_timestamp(),
  `update_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`seq_num`),
  KEY `others_meta_type_IDX` (`type`) USING BTREE,
  KEY `others_meta_id_key_IDX` (`id_key`) USING BTREE,
