DROP TABLE IF EXISTS `report_history`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `report_history` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `target` varchar(100) DEFAULT NULL COMMENT '신고 타켓 - post : 게시판, reply : 댓글',
  `target_id` bigint(20) DEFAULT NULL COMMENT '신고 타겟 아이디(post : 게시판 아이디,  reply : 댓글 아이디)',
  `category` int(11) DEFAULT NULL COMMENT '신고 카테고리 - 1: 명예훼손, 2: 음란성, 3: 폭력 또는 혐오, 4 : 불법, 유해한 콘텐츠, 5 : 기타',
  `reason` varchar(200) DEFAULT NULL COMMENT '신고 사유',
  `content` varchar(500) DEFAULT NULL COMMENT '신고 내용',
  `user_id` bigint(20) DEFAULT NULL COMMENT '신고한 사용자 아이디',
  `create_at` datetime DEFAULT current_timestamp(),
  `update_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_uca1400_ai_ci COMMENT='신고 내역 테이블';
