DROP TABLE IF EXISTS `user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) DEFAULT NULL,
  `nickname` varchar(20) DEFAULT NULL,
  `birth` varchar(20) DEFAULT NULL,
  `phone` varchar(100) DEFAULT NULL,
  `address` varchar(200) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `icon` bigint(20) DEFAULT NULL,
  `my_info` varchar(1000) DEFAULT NULL,
  `retire_chk` int(11) DEFAULT 0 COMMENT '탈퇴 체크 - 0:탈퇴 x, 1:탈퇴',
  `suspend_chk` int(11) DEFAULT 0 COMMENT '정지 체크 - 0:정지x, 1:정지',
  `retire_reason` text DEFAULT NULL COMMENT '탈퇴이유',
  `suspend_reason` text DEFAULT NULL COMMENT '영정 이유',
  `push_chk` int(11) DEFAULT 1 COMMENT '푸시 체크 - 0: 셋x , 1: 셋',
  `lv` int(11) DEFAULT 1 COMMENT '회원 레벨, 256 는 관리자',
  `gender` int(11) NOT NULL DEFAULT 1 COMMENT '성별 1:남, 2: 여',
  `fcm_token` varchar(200) DEFAULT '',
  `following_cnt` int(11) DEFAULT 0,
  `follower_cnt` int(11) DEFAULT 0,
  `create_at` datetime DEFAULT current_timestamp(),
  `update_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_nickname_IDX` (`nickname`,`phone`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=133 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_uca1400_ai_ci;
