CREATE TABLE `video_post` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) DEFAULT NULL,
  `content` varchar(500) DEFAULT NULL,
  `video` varchar(200) DEFAULT NULL,
  `thumbnail` int(11) DEFAULT NULL,
  `view_cnt` int(11) DEFAULT 0,
  `like_cnt` int(11) DEFAULT 0,
  `dibs_cnt` int(11) DEFAULT 0,
  `reply_cnt` int(11) DEFAULT 0,
  `score_sum` double DEFAULT 0,
  `score_cnt` int(11) DEFAULT 0,
  `tags` text DEFAULT NULL,
  `blind_chk` int(11) DEFAULT 0,
  `user_id` bigint(20) DEFAULT NULL,
  `my_info` varchar(1000) DEFAULT NULL,
  `copyright` int(11) DEFAULT 1 COMMENT '저작권 동의항목',
  `create_at` datetime DEFAULT current_timestamp(),
  `update_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `video_post_user_id_IDX` (`user_id`) USING BTREE,
  KEY `video_post_video_IDX` (`video`) USING BTREE
